import React from 'react';
import "./style.css";

const Navbar = () => {
    return (
        <>
            <div className="navbar">
                <div className="btn-group">
                    <button className='btn-group--item'>Breakfast</button>
                </div>    
            </div>
        </>
    )
}

export default Navbar;
